Important Heads Up to Miners and Validators!!
We are planning on migrating to the mistral model `mistralai/Mistral-Small-3.1-24B-Instruct-2503`

This was talked about for a few months, and now we're officially taking the plunge. 

Validators: This is a gated repo, and as such, you will need to make sure you accept the terms on hugging face at https://huggingface.co/mistralai/Mistral-Small-3.1-24B-Instruct-2503

Miners: The model for inference tasks will change, this is nothing new for y'all, except that this model supports the new message format of ```[
    {"role": "system", "content": SYSTEM_PROMPT},
    {
        "role": "user",
        "content": [
            {
                "type": "text",
                "text": "Which of the depicted countries has the best food? Which the second and third and fourth? Name the country, its color on the map and one its city that is visible on the map, but is not the capital. Make absolutely sure to only name a city that can be seen on the map.",
            },
            {"type": "image_url", "image_url": {"url": image_url}},
        ],
    },
]``` Since the inference task requires no custom parsing, we will make the switch pretty quickly, but we will keep the legacy message structure for non-inference tasks for a while longer to allow more ease in transitioning. 

Happy Mining!

For clarity, Macrocosmos does not run a miner on SN1. We focus on building a fair incentive mechanism. If people find ways to exploit this in ways you feel are unfair, please help us by highlighting the code issues, and we will gladly patch this, submit a PR, or improve. Baseless claims without evidence are not sufficient for us to improve SN1. 

@Gold_TAO is a valued miner, but also rarely gives us detail as to what he is concerned about or in any great detail, and we've never had any validation or proof of issues where we are apparently secretly mining the whole subnet. 

We run extensive monitoring for issues on SN1, and if there are other edge cases or behaviours we should monitor, please let me know and we will add those and improve them. Tracking discrete wallets that are apparently "cheating" without any detail of how they believe an exploit is being dealt with are distractions from us developing this subnet further.

